int my_itoa(int n, char *buf)
{
	int num_digits = 0;
	int n2 = n;
	int i;
	int c;

	while (n) {
		n /= 10;
		num_digits++;
	}

	n = n2;
	i = num_digits-1;

	while(n) {
		c = n % 10;
		n /= 10;
		buf[i] = '0' + c;
		i--;
	}

	return num_digits;
}

void start()
{
	int i;
	int sum = 0;
	char buf[128];
	int len;
	DWORD bytesWritten;

	for (i = 0; i < sizeof(buf); i++)
		buf[i] = 0;

	for (i = 0; i < sizeof(arr) / sizeof(arr[0]); i++)
		sum += arr[i];

	len = my_itoa(sum, buf);
	buf[len++] = '\n';

	WriteFile(GetStdHandle(STD_OUTPUT_HANDLE), buf, len, &bytesWritten, NULL);

	ExitProcess(0);
}
